class App extends Component {
  constructor(props) {
    //TODO
    super(props);
    var time = this.callAPI();
    this.state = { time: time };

    console.log("in constructor");
  }

  callAPI() {
    console.log("in callAPI");

    fetch("http://localhost:9000/timer/")
      //.then((res) => res.text())
      .then((res) => {
        console.log("time: " + res.timerValue);
        console.log("res: " + res);
        return res.timerValue;
      });
  }
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <p className="App-intro">{this.state.time}</p>
          <p>Hello Boozer!</p>
        </header>
      </div>
    );
  }
}

export default App;
